    render(){
        state={
            balance:0,
        };
        balanceIncrement=(value)=>{
            this.setState({balance: this.state.balance + value});
        }
        const{name}=this.props;

        return( <> 

        <h1>{name}</h1>
        <button >Family Income</button>
        <ChildComponent name={"Aniket"}/>
        <ChildComponent name={"Shubham"}/>


        </>
        );
    }

}
export default ParentComponent;
